       {renderSoundPad(13)}
       {renderSoundPad(14)}
       {renderSoundPad(15)}
      </div>
      <div className="PadsRow">
       {renderSoundPad(16)}
       {renderSoundPad(17)}
       {renderSoundPad(18)}
       {renderSoundPad(19)}
       {renderSoundPad(20)}
      </div>
      <div className="PadsRow">
       {renderSoundPad(21)}
       {renderSoundPad(22)}
       {renderSoundPad(23)}
       {renderSoundPad(24)}
       {renderSoundPad(25)}
      </div>

      </div>
      </div>
  );
}

export default App;
